"""### Nyquist-Shannon Theorem

**Nyquist-Shannon Theorem** กล่าวว่า การสุ่มตัวอย่างสัญญาณ (sampling) ต้องมีอัตราการสุ่มตัวอย่าง (sampling rate) ที่ไม่น้อยกว่า 2 เท่าของความถี่สูงสุดของสัญญาณต้นฉบับ (original signal) เพื่อป้องกันปัญหาการบิดเบือน (aliasing) ซึ่งเกิดจากการที่สัญญาณที่มีความถี่สูงเกินไปจะไม่สามารถจับข้อมูลได้ครบถ้วนในระบบดิจิทัล

### กฎของ Nyquist-Shannon:  
$$
f_s \geq 2f_{\text{max}}
$$

ซึ่งสัญลักษณ์ในสูตรนี้หมายถึง:

- $f_s$ คือ ความถี่สุ่มตัวอย่าง (Sampling Frequency)
- $f_{\text{max}}$ คือ ความถี่สูงสุดของสัญญาณต้นฉบับ (Maximum Frequency of the Signal)


![image.png](data:image/png;base64,)
"""

