"""## 2. Discrete-Time signal Processing

### Fourier Series
"""

import numpy as np
import matplotlib.pyplot as plt

# ฟังก์ชัน Square Wave Periodic
def square_wave(x):
    return np.sign(np.sin(2 * np.pi * x))

# คำนวณ Fourier coefficients
def calculate_fourier_coefficients(f, L, N):
    a_0 = (1 / (2 * L)) * np.trapz([f(x) for x in np.linspace(-L, L, 1000)], dx=2*L/1000)
    a_n = np.zeros(N)
    b_n = np.zeros(N)

    for n in range(1, N+1):
        a_n[n-1] = (1 / L) * np.trapz([f(x) * np.cos(n * np.pi * x / L) for x in np.linspace(-L, L, 1000)], dx=2*L/1000)
        b_n[n-1] = (1 / L) * np.trapz([f(x) * np.sin(n * np.pi * x / L) for x in np.linspace(-L, L, 1000)], dx=2*L/1000)

    return a_0, a_n, b_n

# ฟังก์ชัน Fourier Series approximation
def fourier_series(x, a_0, a_n, b_n, L, N):
    result = a_0
    for n in range(1, N+1):
        result += a_n[n-1] * np.cos(n * np.pi * x / L) + b_n[n-1] * np.sin(n * np.pi * x / L)
    return result

# ตัวแปร
L = 1  # ความยาวของช่วง [-L, L]
N = 60  # จำนวนเทอมใน Fourier series
x = np.linspace(-L, L, 1000)

# คำนวณ Fourier coefficients
a_0, a_n, b_n = calculate_fourier_coefficients(square_wave, L, N)

# สร้าง Fourier series approximation
f_approx = fourier_series(x, a_0, a_n, b_n, L, N)

# แสดงผล
plt.figure(figsize=(15, 6))
plt.plot(x, square_wave(x), label="Square Wave", color='black', linestyle='--')
plt.plot(x, f_approx, label="Fourier Series Approximation", color='blue')
plt.xlabel('x')
plt.ylabel('y')
plt.title('Fourier Series Approximation of Square Wave')
plt.legend()
plt.grid(True)
plt.show()

