"""### Filter (Signal processing)

![image.png](data:image/png;base64,)

![ดาวน์โหลด (1).png](data:image/png;base64,)
"""

import numpy as np
import matplotlib.pyplot as plt
from scipy.signal import butter, filtfilt



#  lowpass Filter
def butter_lowpass(cutoff, fs, order=4):
    nyquist = 0.5 * fs
    normal_cutoff = cutoff / nyquist
    b, a = butter(order, normal_cutoff, btype='low')
    return b, a


#  highpass Filter
def butter_highpass(cutoff, fs, order=4):
    nyquist = 0.5 * fs
    normal_cutoff = cutoff / nyquist
    b, a = butter(order, normal_cutoff, btype='high')
    return b, a


#  Band-Pass Filter
def butter_bandpass(lowcut, highcut, fs, order=4):
    nyquist = 0.5 * fs  # Nyquist frequency
    low = lowcut / nyquist
    high = highcut / nyquist
    b, a = butter(order, [low, high], btype='band')
    return b, a


# Notch Filter
def butter_notch(cutoff, fs, order=4):
    nyquist = 0.5 * fs
    normal_cutoff = cutoff / nyquist
    b, a = butter(order, normal_cutoff, btype='bandstop')
    return b, a

"""##### 1.  Low-Pass Filter"""

# Define cutoff frequency (frequency below which signal will pass)
cutoff = 10 # Low-pass filter cutoff frequency at 10 Hz

# Apply the low-pass filter to the sampled signal
b, a = butter_lowpass(cutoff, fs, order=4)
x_filtered = filtfilt(b, a, x_sampled)  # Apply the filter to the signal

# Compute FFT for original and filtered signals
fft_original = np.fft.fft(x_sampled)  # FFT of the original signal
fft_filtered = np.fft.fft(x_filtered)  # FFT of the filtered signal
freq = np.fft.fftfreq(len(fft_original), d=1/fs)  # Frequency values corresponding to the FFT

# === Create Subplots (2x2) ===
fig, axes = plt.subplots(2, 2, figsize=(14, 8))  # Create a 2x2 grid for the plots

# Plot 1: Original Sampled Signal (Time Domain)
axes[0, 0].plot(t_sampled, x_sampled, 'r', alpha=0.7, label="Original Sampled Signal")  # Original signal plot
axes[0, 0].set_xlabel('Time (s)')  # X-axis label
axes[0, 0].set_ylabel('Amplitude')  # Y-axis label
axes[0, 0].set_title('Original Sampled Signal (Time Domain)')  # Title for the plot
axes[0, 0].legend()  # Display the legend
axes[0, 0].grid()  # Add grid lines

# Plot 2: Low-Pass Filtered Signal (Time Domain)
axes[0, 1].plot(t_sampled, x_filtered, 'b', label=f"Low-Pass Filtered (≤ {cutoff} Hz)")  # Filtered signal plot
axes[0, 1].set_xlabel('Time (s)')  # X-axis label
axes[0, 1].set_ylabel('Amplitude')  # Y-axis label
axes[0, 1].set_title(f'Low-Pass Filtered Signal (≤ {cutoff} Hz)')  # Title for the plot
axes[0, 1].legend()  # Display the legend
axes[0, 1].grid()  # Add grid lines

# Plot 3: FFT of Original Signal
axes[1, 0].plot(freq[:len(freq)//2], np.abs(fft_original)[:len(freq)//2], 'r', label="Original FFT")  # FFT plot of original signal
axes[1, 0].set_xlabel('Frequency (Hz)')  # X-axis label
axes[1, 0].set_ylabel('Magnitude')  # Y-axis label
axes[1, 0].set_title('FFT of Original Signal')  # Title for the plot
axes[1, 0].legend()  # Display the legend
axes[1, 0].grid()  # Add grid lines

# Plot 4: FFT of Filtered Signal
axes[1, 1].plot(freq[:len(freq)//2], np.abs(fft_filtered)[:len(freq)//2], 'b', label=f"Filtered FFT (≤ {cutoff} Hz)")  # FFT plot of filtered signal
axes[1, 1].set_xlabel('Frequency (Hz)')  # X-axis label
axes[1, 1].set_ylabel('Magnitude')  # Y-axis label
axes[1, 1].set_title(f'FFT of Low-Pass Filtered Signal (≤ {cutoff} Hz)')  # Title for the plot
axes[1, 1].legend()  # Display the legend
