import numpy as np
import matplotlib.pyplot as plt
from scipy.signal import butter, filtfilt

# Time and Signal Generation
t_cont = np.linspace(0, 1, 1000)  # Continuous Time (1 sec)
x_cont = np.sin(2 * np.pi * 5 * t_cont) + np.cos(2 * np.pi * 9 * t_cont) + np.sin(2 * np.pi * 20 * t_cont) + np.cos(2 * np.pi * 40 * t_cont) + 2 * np.sin(2 * np.pi * 60 * t_cont)
fs = 400
t_sampled = np.arange(0, 1, 1/fs)
x_sampled = np.sin(2 * np.pi * 5 * t_sampled) + np.cos(2 * np.pi * 9 * t_sampled) + np.sin(2 * np.pi * 20 * t_sampled) + np.cos(2 * np.pi * 40 * t_sampled) + 2 * np.sin(2 * np.pi * 60 * t_sampled)

# Adding high-level noise to the signal (increase the noise level)
x_noisy = x_sampled + 5 * np.random.normal(0, 1, len(x_sampled))

# Band-pass filter design (4 Hz to 70 Hz)
lowcut = 30
highcut = 70

# Butterworth band-pass filter
def butter_bandpass(lowcut, highcut, fs, order=4):
    nyquist = 0.5 * fs
    low = lowcut / nyquist
    high = highcut / nyquist
    b, a = butter(order, [low, high], btype='band')
    return b, a

# Apply the band-pass filter to the noisy signal
b, a = butter_bandpass(lowcut, highcut, fs)
x_filtered = filtfilt(b, a, x_noisy)

# Plotting the original signal and noisy signal in time domain
plt.figure(figsize=(10, 4))
plt.plot(t_sampled, x_noisy, 'r', alpha=0.5, label="Noisy Signal")
plt.plot(t_sampled, x_sampled, 'b', label="Original Signal")
plt.plot(t_sampled, x_filtered, 'g', label="Filtered Signal")
plt.xlabel('Time (s)')
plt.ylabel('Amplitude')
plt.title('Noisy Signal and Filtered Signal')
plt.legend()
plt.grid()
plt.show()

# Perform FFT on the filtered signal
fft_result_filtered = np.fft.fft(x_filtered)
freq = np.fft.fftfreq(len(fft_result_filtered), d=1/fs)

# Plotting the FFT (frequency domain) of the filtered signal
plt.figure(figsize=(10, 4))
plt.plot(freq[:len(freq)//2], np.abs(fft_result_filtered)[:len(freq)//2], 'g')
plt.xlabel('Frequency (Hz)')
plt.ylabel('Magnitude')
plt.title('FFT of Filtered Signal')
plt.grid()
plt.show()

# Generating the spectrogram of the filtered signal
plt.figure(figsize=(10, 6))
plt.specgram(x_filtered, Fs=fs, NFFT=256, noverlap=128)
plt.xlabel('Time (s)')
plt.ylabel('Frequency (Hz)')
plt.title('Spectrogram of Filtered Signal')
plt.colorbar(label='Intensity (dB)')
plt.grid(True)
plt.show()

import numpy as np
import matplotlib.pyplot as plt
from scipy.signal import chirp, spectrogram

# กำหนดช่วงเวลาการสร้างสัญญาณ
fs = 400  # ความถี่การสุ่มตัวอย่าง (sampling frequency)
t = np.linspace(0, 1, fs)  # เวลา 1 วินาที

# สร้างสัญญาณ Chirp (สัญญาณที่มีการเปลี่ยนแปลงความถี่ตามเวลา)
f0 = 5  # ความถี่เริ่มต้น (5 Hz)
f1 = 100  # ความถี่สุดท้าย (100 Hz)
x_chirp = chirp(t, f0=f0, f1=f1, t1=1, method='linear')  # สัญญาณ Chirp ที่ความถี่เพิ่มขึ้นจาก 5 Hz ไปที่ 100 Hz

# Plot สัญญาณ Chirp ในโดเมนเวลา
plt.figure(figsize=(10, 4))
plt.plot(t, x_chirp, label="Chirp Signal")
plt.xlabel('Time (s)')
plt.ylabel('Amplitude')
plt.title('Chirp Signal (Frequency Change Over Time)')
plt.legend()
plt.grid(True)
plt.show()

# Perform FFT บนสัญญาณ Chirp
fft_result_chirp = np.fft.fft(x_chirp)
freq = np.fft.fftfreq(len(fft_result_chirp), d=1/fs)

# Plot FFT ของสัญญาณ Chirp
plt.figure(figsize=(10, 4))
plt.plot(freq[:len(freq)//2], np.abs(fft_result_chirp)[:len(freq)//2], 'b')
plt.xlabel('Frequency (Hz)')
plt.ylabel('Magnitude')
plt.title('FFT of Chirp Signal')
plt.grid(True)
plt.show()

# Generating Spectrogram ของสัญญาณ Chirp
plt.figure(figsize=(10, 6))
plt.specgram(x_chirp, Fs=fs, NFFT=256, noverlap=128)
plt.xlabel('Time (s)')
plt.ylabel('Frequency (Hz)')
plt.title('Spectrogram of Chirp Signal')
plt.colorbar(label='Intensity (dB)')
plt.grid(True)
plt.show()

